import React from "react";
import Person from "./Person";

function NameList() {
  const names = ["sravan", "kumar", "kittu"];
  const persons = [
    {
      id: 1,
      name: "sravan",
      age: 24,
      skill: "react",
    },
    {
      id: 2,
      name: "krishna",
      age: 24,
      skill: "angular",
    },
    {
      id: 3,
      name: "kumar",
      age: 24,
      skill: "native",
    },
    {
      id: 4,
      name: "reddy",
      age: 24,
      skill: "node",
    },
  ];
  const namesList = names.map((name) => <h2>{name}</h2>);

  return <div>{namesList}</div>;
}

export default NameList;
